const setRating = (rating) => {
    if(rating > 4) {
        return 'bg-success'
    }else if(rating > 3 && rating <= 4) {
            return 'bg-warning'
    }else {
        return 'bg-danger'
    }
}



   
 //templating 
 const createMovieCards =(arr) => {
        let result = ' ';
        arr.forEach(movie =>{
            result += `
                <div class="col-md-3">
                    <figure class="movieCard">
                     
                        <img src="${movie.imgUrl}"
                         alt="${movie.title}"
                         title="${movie.title}">
                       <figcaption>
                        <!-- content -->
                         <div class="ratingTitle">
                          <div class="row">
                            <div class="col-10">
                              <h5 class="m-0">${movie.title}</h5>
                            </div>
                            <div class="col-2">
                              <small class="rating bg-success p-2 ${setRating(movie.rating)}"> ${movie.rating} </small>
                            </div>
                          </div>
                         </div>
                           <div class="movieInfo">
                               <h2>${movie.title}</h2>
                               <p class="overview">
                               ${movie.description}
                               </p>
                           </div>

                           <div class="active">
                              <button class="btn btn-sm btn-outline-info"> Edit </button>  
                              <button class="btn btn-sm btn-outline-danger"> Remove </button>  
                          </div>
                       </figcaption>
                    </figure>
                  </div>
            `
        });
        movieContainer.innerHTML = result;
 }
  createMovieCards(moviesArr);


