const  onMovieAdd = (eve) => {
    eve.preventDefault();

    /**movie object */
    let obj = {
        title : movieTitleControl.value,
        imgUrl : movieImgUrlControl.value,
        description : movieDescriptionControl.value,
        rating : movieRatingControl.value,
    }

    //cl(obj);
// array mday push kraych
    moviesArr.unshift(obj);

    // templating ko function ko call krna hai
     // createMovieCards(moviesArr); // recreate krt aahe card mhnun khalch obj cretae kel aahe

     //instead of templating create a single movie card  and prepend in UI
        let card = document.createElement("div"); // document obj create kel
        card.className = `col-md-3`
        card.innerHTML =`
                       <figure class="movieCard">
                     
                        <img src="${obj.imgUrl}"
                         alt="${obj.title}"
                         title="${obj.title}">
                       <figcaption>
                        <!-- content -->
                         <div class="ratingTitle">
                          <div class="row">
                            <div class="col-10">
                              <h5 class="m-0">${obj.title}</h5>
                            </div>
                            <div class="col-2">
                              <small class="rating bg-success p-2 ${setRating(obj.rating)}"> ${obj.rating} </small>
                            </div>
                          </div>
                         </div>
                           <div class="movieInfo">
                               <h2>${obj.title}</h2>
                               <p class="overview">
                               ${obj.description}
                               </p>
                           </div>

                           <div class="active">
                              <button class="btn btn-sm btn-outline-info"> Edit </button>  
                              <button class="btn btn-sm btn-outline-danger"> Remove </button>  
                          </div>
                       </figcaption>
                    </figure>
        
        `

        movieContainer.prepend(card);
    // reset from
    movieForm.reset();
    onModalToggle();

}










